script: |
  super -f text -I q9634.spq | sort > q9634.out

inputs:
  - name: q9634.spq
    data: |
      SELECT + - col2 - + + col2 * - + col0 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - 69 IS NULL OR NOT ( - 9 > - + 99 * + ( col0 ) + + col2 );
  - name: tab0

outputs:
  - name: q9634.out
    data: |
      658
      860
      9504
